Is it possible to do a conditional aggregation in Java Spring?<p>I am using Spring and MongoDB with MongoTemplate.</p>

<p>I have this document:</p>

<pre><code>{
  price: 50.0,
  goal: {
       currentValue: 20,
       goal: 100
  }
}
</code></pre>

<p>I need to do a query such as "<strong>bring me the values where its current value is the same as the goal</strong>" or "<strong>bring me the documents where its current value is 50% of its goal</strong>".</p>

<p>Is it possible to do this? So far I've been doing this kind of queries but never did a conditional one where it uses the documents current values as part of the condition.</p>

<pre><code>Criteria criteria = Criteria.where("price").exists(true);

GroupOperation totalAggregation = group()
      .sum("goal.currentValue")
      .as("currentValue")
      .sum("goal.goal")
      .as("goal");
UnwindOperation unwind = unwind("$goal");
Aggregation aggregation = newAggregation(match(criteria), unwind, totalAggregation);

AggregationResults&lt;Document&gt; results = mongoTemplate
                .aggregate(aggregation,"Goals", Document.class);
</code></pre>

<p>Now I just want to bring the ones with the scenario that I described above only. How to do this?</p>

<p>Thanks.</p>

