How can i use MongoDB aggregation to conditionally match fields from a search form that aren't null?<p>I have a large search form on my website with 10+ optional search parameters. I need to return all documents from MongoDB that match whichever form fields are present in each search. </p>

<p>One way to achieve desired results is to write if else statements for every possible combination of non empty search fields in order, but there has to be a better way.</p>

<pre><code>    ex.
    const sQ = new TMDLs(request.body);


    }else if(sQ.Basin &amp;&amp; sQ.Water_Body_Name &amp;&amp; sQ.Water_Body_ID){
        searchData = await TMDLs.aggregate([
            { $match: { $text: {$search: `\"${sQ.Basin}\"`}}},
            { $match: { Water_Body_Name: sQ.Water_Body_Name}},
            { $match: { Water_Body_ID: sQ.Water_Body_ID}}

        ]);
    }else if(sQ.Basin &amp;&amp; sQ.Water_Body_Name){
        searchData = await TMDLs.aggregate([
            { $match: { Basin: sQ.Basin }},
            { $match: {Water_Body_Name: sQ.Water_Body_Name}}
        ]);
</code></pre>

<p>The code above works but it is impractical to try every combination of non empty search parameters. I need the aggregation results to return all records that match the non empty search fields.</p>

<p>I've tried $ifNull, $exists, $group, $project, and many other conditional operators but I can't find anything that answers this problem.</p>

