<p>The query is case sensitive and I want to use the $toLower aggregator to make it a insensitive case query.</p>

<p>But I can't seem to figure out how to include the $toLower operator.</p>

<p>Here is my code:</p>

<pre><code>export let findByFirstOrLastName = (req: Request, res: Response) =&gt; {
    User.find({$or: [
        {firstName: req.params.name},
        {lastName: req.params.name}
    ]}).exec((err, user) =&gt; {
        if(err) {
            res.send(err);
        } else {
            res.send(user);
        }
    })
}
</code></pre>

<p>I've tried it just before the $or and also on each of the fields.</p>

<p>Any help would be appreciated.</p>; Answer: @lleaff ah so you mean in some of the main functions add a condition to check a pre-configured token that is fetched from the database and checked against user credentials?..  hmm that sounds promising, but yes it could still be cracked because the token would still reside in the javascript condition..

