MongoDB aggregation framework support non-aggregation operations?<p>I have following query using MongoDB aggregation,</p>

<pre><code>db.users.aggregate({$project: {"name":1}})
</code></pre>

<p>The result is:</p>

<pre><code>{ "_id" : ObjectId("5d19a17a368e9d89b84269b2"), "name" : "sharon" }
{ "_id" : ObjectId("5d19a186368e9d89b84269b5"), "name" : "paul" }
{ "_id" : ObjectId("5d19a1a7368e9d89b84269b8"), "name" : "paul" }
{ "_id" : ObjectId("5d19a1bb368e9d89b84269bb"), "name" : "sharon" }
{ "_id" : ObjectId("5d19a1ca368e9d89b84269be"), "name" : "paul" }
{ "_id" : ObjectId("5d19a1cf368e9d89b84269c1"), "name" : "paul" }
</code></pre>

<p>This is effectively equivalent to </p>

<pre><code>db.users.find({"name":1})
</code></pre>

<p>So, I am confused and surprised that <code>aggregate</code> support non-aggregation operations,</p>

<p>I have thought that <code>aggregate</code> is similar to <code>SQL group by</code>, but the above query is impossible in SQL</p>

