Creating a filter in mongo-go-driver for .FindOne<p>I'm trying to check a collection to see if there is at least one documents that match a specific set of values. </p>

<p>I've tried reading the documentation at <a href="https://github.com/mongodb/mongo-go-driver#usage" rel="nofollow noreferrer">https://github.com/mongodb/mongo-go-driver#usage</a>, but I can't seem to find much help there. I'm pretty new to MongoDB &amp; Go, I believe that this is more a problem of my lack of experience.</p>

<p>Here is a sample query from Studio 3T that I'm trying to run with mongo-go-driver:</p>

<pre><code>db.getCollection("events").find(
    { 
        "event.eventType" : "OSR", 
        "context.vehicleId" : NumberInt(919514), 
        "ts" : {
            "$gte" : ISODate("2019-06-21T21:38:43.022+0000")
        }
    }
).limit(1);
</code></pre>

<p>It seems that the <code>context.FindOne</code> method will do what I want (and eliminating the need for the <code>.limit(1)</code>). I thought that it would be straight forward to "port" this to Go and the mongo-go-driver.</p>

<p>I can sort of make this work, for example I have the following which will find me all the OSR:</p>

<pre class="lang-golang prettyprint-override"><code>var query = &amp;bson.D{
        {"event.eventType", "OSR"},
    }

result := bson.D{}
e := collection.FindOne(context.TODO(), query).Decode(&amp;result)
</code></pre>

<p>This will return me one document. Now, if I want to include the <code>vehicleId</code> value, and I update the <code>query</code> to:</p>

<pre class="lang-golang prettyprint-override"><code>var query = &amp;bson.D{
        {"event.eventType", "OSR"},
        {"context.vehicleId", 919514}, 
    }
</code></pre>

<p>No documents are returned. I haven't bother to expand <code>query</code> to include the <code>ts</code> field yet.</p>

<p>I would expect at to still have at least one document returned, but nothing is showing up.  Does anybody have some tips, suggestions or guidance on what I'm doing wrong (or perhaps how I can do this better)?</p>

